svg.script:
function clippify(event) {
    elem = event.target;
    text = elem.childNodes[1].textContent;
    navigator.clipboard.writeText(text);
    console.log(text);
}
var circles = document.getElementsByTagName('circle');
for (i = 0; i < circles.length; i++) {
    circle = circles[i];
    circle.onclick = clippify;
}
